<template>
  <div>
    <!-- <div style="height: 20vh; margin-bottom: 5vh"></div> -->
    <div style="height: 20vh; margin-bottom: 5vh">
      <top></top>
      <div class="bread-crumb">
        <el-breadcrumb separator="/">
          <el-breadcrumb-item :to="{ path: '/' }">首页</el-breadcrumb-item>
          <el-breadcrumb-item>产品详情</el-breadcrumb-item>
        </el-breadcrumb>
      </div>
      <div class="enter-shop"><el-link icon="el-icon-s-shop" @click="gotoShop">进入店铺</el-link></div>
    </div>
    <div style="height: 50vh">
      <!-- 图片 -->
      <div class="demo-image">
        <div>
          <el-image :src="url" style="height: 50vh; width: 30vw"></el-image>
        </div>
      </div>

      <!-- 介绍 -->
      <div class="demo-info">
        <!-- 产品名称 -->
        <div id="product-name">
          <h1 class="title" style="text-align: left; margin-top: 0px">
            {{ productName }}
          </h1>
        </div>

        <!-- 价格 -->
        <div class="primaryPrice">
          <span style="float: left; align-self: center"
            >原价：￥{{ startPrice }}</span
          >
        </div>

        <div class="price">
          <span style="float: left; align-self: center"
            >折后价：￥{{ nowPrice }}</span
          >
        </div>

        <!-- 类别 -->
        <div class="type">
          <span style="float: left; align-self: center">类型：{{ type }}</span>
        </div>

        <!-- 显示库存 -->
        <div class="inventory">
          <span style="float: left; align-self: center"
            >库存：{{ inventory }}</span
          >
        </div>

        <!-- 购买数量 -->
        <div class="buy-number">
          <el-input-number
            v-model="addCartForm.num"
            :min="1"
            :max="10"
            label="描述文字"
          ></el-input-number>
          <el-button plain @click="addToCart()">加入购物车</el-button>
          <el-button type="primary" plain>立即购买</el-button>
        </div>
      </div>
    </div>
    <Comment></Comment>
  </div>
</template>

<script>
import Comment from "../components/Comment.vue";
import Top from "../components/Top.vue";
export default {
  components: { Top, Comment },
  name: "Detail",
  data() {
    return {
      productName: "",
      startPrice: "",
      nowPrice: "",
      type: "",
      inventory: "",
      addCartForm: {
        num: 1,
        productId: "",
        userId: "",
      },
      url:
        "data:image/jpeg;base64,",
      
    };
  },
  mounted() {
    this.getMessage();
  },
  methods: {
    getMessage() {
      this.url = this.$getSessionStorage("productMessage").picture;
      this.productName = this.$getSessionStorage("productMessage").productName;
      this.startPrice = this.$getSessionStorage("productMessage").startPrice;
      this.nowPrice = this.$getSessionStorage("productMessage").nowPrice;
      this.type = this.$getSessionStorage("productMessage").type;
      this.inventory = this.$getSessionStorage("productMessage").inventory;
      this.addCartForm.productId = this.$getSessionStorage(
        "productMessage"
      ).productId;
      this.addCartForm.userId = this.$getSessionStorage("user").userId;
    },
    addToCart() {
      if (!this.$getSessionStorage("user")) {
        this.$message.error("请先登录！");
        this.$router.push({ path: "/login" });
      } else {
        this.$axios
          .post("demo/cart/addToCart", this.$qs.stringify(this.addCartForm))
          .then((res) => {
            if (res == -1) {
              this.$message.error("加入购物车失败！");
              return false;
            } else {
              this.$message.success("加入购物车成功！");
              return true;
            }
          })
          //异常
          .catch((error) => {
            console.log(error);
          });
      }
    },
    gotoShop(){
      //根据化妆品ID获取店铺信息
      this.$axios
        .post("demo/product/getStoreInfo",this.$qs.stringify({productId:this.addCartForm.productId}))
        .then((res)=>{
          this.$setSessionStorage("storeMessage",res.data);
          this.$router.push({ path: "/shopIndex" });
        })
        .catch((e)=>{
          this.$message.error("服务器内部发生异常");
          console.log(e);
        })
    }
  },
};
</script>

